INSERT INTO `question_iar` VALUES (1,'نصب بنر شروع و پایان و تاریخ آزمون جلوی درب حوزه','این بنر بایستی در جلوی حوزه قرار گرفته شده باشد و ساعت شروع و پایان آزمون در آن قابل رویت باشد.',5,1,0,'2019-07-10 06:30:59','2019-07-10 06:30:59'),(2,'نصب پلان حوزه، برگه راهنما و فلش های راهنما در حوزه','برگه هایی که کمک کند براحتی کلاس هر پشتیبان را پیدا کنید',5,1,0,'2019-07-10 06:32:06','2019-07-10 06:32:06'),(3,'عکس حوزه قبل از ساعت 7 و فرمت آن','می توانید از مدیر جویا شوید',5,1,2,'2019-07-10 06:33:28','2019-07-17 14:32:54'),(4,'نصب اسامی پشتیبان ها درب کلاس','نام هر پشتیبان در جلو هر کلاس بایستی مشخص باشد.',5,1,2,'2019-07-10 06:34:28','2019-07-10 06:34:28'),(5,'ظاهر آموزشی مدیران و پشتیبان ها','همه مدیران و پشتیبان ها باید لباس های کاملا رسمی برتن داشته باشند',5,1,2,'2019-07-10 06:35:45','2019-07-10 06:35:45'),(6,'کارت شناسایی عکس دار دورو(مدیران و پشتیبانان به گردن)','تمامی افراد مسئول در حوزه باید کارت شناسایی عکس دار داشته باشند.',5,1,2,'2019-07-10 06:37:13','2019-07-10 06:37:13'),(7,'یک مدیر قبل از شروع آزمون تا 30 دقیقه پس از شروع آزمون در جلوی درب حوزه بایستد','در زمان شروع آزمون مدیر بایستی در جلوی درب حوزه باشد.',5,1,0,'2019-07-10 06:37:56','2019-07-10 06:49:17'),(8,'محل مخزن بصورت جدا گانه و به دور از دسترس دانش آموزان و افراد غیرمجاز','محل مخزن باید جایی بدور از دسترس افراد غیر مجاز باشد و محل تردد دانش آموزان نباشد.',5,1,2,'2019-07-10 06:39:36','2019-07-10 06:53:50'),(9,'محل جداگانه متاخرین و داشتن یک مراقب','هیچ دانش آموز متاخری نباید در بین دانش آموزان دیگر بنشیند چرا که باعث بهم خوردن نظم آزمون می گردد.',5,1,2,'2019-07-10 06:41:24','2019-07-10 06:50:17'),(10,'شروع به موقع و پاسخگویی به سوالات نظرخواهی و عدم اعمال نظر','در صورت رویت هرگونه اعمال نظر و تقلب در اینجا  اسامی آن فرد را گزارش دهید.',5,1,1,'2019-07-10 06:42:57','2019-07-10 06:42:57'),(11,'شروع به موقع آزمون در حوزه',NULL,5,1,2,'2019-07-10 06:44:15','2019-07-10 06:44:15'),(12,'عدم خروج زود هنگام در طول آزمون','در طول آزمون نباید دانش آموزان زودتر از اتمام آزمون خارج شوند',5,1,2,'2019-07-10 06:46:52','2019-07-10 06:46:52'),(13,'داشتن فرم بازرسی داخلی پشتیبانان توسط هر مدیر','هر پشتیبان موظف است قبل از حضور بازرس در حوزه فرم بازرسی داخلی را پرنموده باشد',5,1,2,'2019-07-10 06:57:52','2019-07-10 06:57:52'),(14,'نظم و سکوت در حوزه در زمان برگزاری آزمون','لطفا درصورت نمره کمتر از سبز علت درج شود',5,1,0,'2019-07-10 06:58:53','2019-07-10 06:58:53'),(15,'برگزاری کلاس رفع اشکال','برای این آیتم بایستی کلاس های رفع اشکال را رویت نمایید',5,1,2,'2019-07-10 07:00:19','2019-07-10 07:00:19'),(16,'نوشتن برگه خودنگاری و هدف گذاری','برگه خودنگاری دانش آموزان بررسی شود',5,1,2,'2019-07-10 07:01:55','2019-07-10 07:01:55'),(17,'دفتر برنامه ریزی','دفتر برنامه ریزی دانش آموزان باید دقیق آمار گرفته شود و برخی را بصورت تصادفی بررسی نمایید',5,1,2,'2019-07-10 07:04:06','2019-07-10 07:04:06'),(18,'کتاب خودآموزی','تعداد کتاب خود آموز دانش آموزان باید آمار گرفته شود و برخی را بصورت تصادفی بررسی نمایید',5,1,2,'2019-07-10 07:05:47','2019-07-10 07:05:47'),(19,'امتیاز آزاد بازرس از 10 امتیاز (کار ویژه ها و نظم کلی و کیفیت برگزاری آزمون)','لطفا علت امتیازی که داده اید را ذکر نمایید',10,1,4,'2019-07-10 07:08:36','2019-07-10 07:08:36');
